import { NavLink } from "react-router-dom";
import { items, NavItems } from "./itemsNav";

export const Navbar = () => {
  const signOutClick = () => {
    console.log("SIGN OUT");
  };
  return (
    <nav>
      <NavLink to="/">Navbar</NavLink>
      {items.map((resp: NavItems) => (
        <NavLink key={resp.id} to={resp.link}>{resp.label}</NavLink>
      ))}
      <NavLink to="/sign-out" onClick={signOutClick}>
        Sign Out
      </NavLink>
    </nav>
  );
};
